import React from 'react';
import './cardPrincipal.css';
import ReactDOM from 'react-dom';

function tick() {
    const element = (
      <div>
        <h1>Hello, world!</h1>
        <h2>It is {new Date().toLocaleTimeString()}.</h2>
      </div>
    );
    ReactDOM.render(
      element,
      document.getElementById('root')
    );
}


const CardPrincipal = () => (
    <div className="cardPrincipal">
        {this.state.tick()}
    </div>
);


export default CardPrincipal;
